import React from 'react'

const NumPad = () => {
  const keys1 = ["7","8","9"]
  const keys2 = ["4","5","6"]
  const keys3 = ["1","2","3"]
  const keys4 = ["0","ENTER"]
  return (
    <div className='keyboard'>
      <div className='numLine'>
        {keys1.map((key)=>{
        return <div> {key} </div>;
      })}
      </div>
      <div className='numLine'></div>
      <div className='numLine'></div>
      <div className='zeroLine'></div>
    </div>
  )
}

export default NumPad
